> North Carolina Carson raising millions to become '16 fundraising juggernaut Ben Carson for President Barry Bennett, center, places a paper '1' on a cake in honor of the $31 million, the total amount raised the campaign has raised since Carson announced his White House bid in May, with staff at the Carson campaign headquarters in Alexandria, Va., Wednesday, Sept. 30, 2015. Carson raised more than $20 million in the past three months to fuel his bid for the Republican presidential nomination, his campaign said Wednesday, a haul of campaign cash that shatters records and sets a new bar for his GOP rivals. (AP Photo/Cliff Owen) 
